import { BrowserRouter, Route, Routes } from "react-router-dom";
import Dashboard from "./components/Dashboard.js";
import Navbar from "./components/Navbar.js";
import Login from "./components/Login.js";
import Register from "./components/Register.js";
import ProductAdd from "./components/Product/ProductAdd.js";
import ProductEdit from "./components/Product/ProductEdit.js";
import ProductsList from "./components/Product/ProductsList.js";
import UserAdd from "./components/User/UserAdd.js";
import UserEdit from "./components/User/UserEdit.js";
import UserList from "./components/User/UserList.js";
import Sidebar from "./components/Sidebar.js";
import "./css/main"

function App() {
  return (
    <BrowserRouter>
      <link rel="stylesheet" href="https://cdn.materialdesignicons.com/4.9.95/css/materialdesignicons.min.css"></link>
      <link rel="stylesheet" href="../css/main.min.css"></link>
      <Routes>
        <Route exact path="/" element={<Login/>}/>
        <Route exact path="/register" element={<Register/>}/>
        <Route exact path="/dashboard" element={<><Sidebar/></>}/>
        <Route exact path="/product" element={<><Navbar/><ProductsList/></>}/>
        <Route exact path="/product/add" element={<><Navbar/><ProductAdd/></>}/>
        <Route exact path="/product/edit/:id" element={<><Navbar/><ProductEdit /></>}/>
        <Route exact path="/user" element={<><Navbar/><UserList/></>}/>
        <Route exact path="/user/add" element={<><Navbar/><UserAdd/></>}/>
        <Route exact path="/user/edit/:id" element={<><Navbar/><UserEdit /></>}/>
      </Routes>
      <script type="text/javascript" src="../js/main.min.js"></script>
    </BrowserRouter>
  );
}

export default App;
